import React from 'react';
import {Link} from 'react-router-dom';

const HomePage = () => (
    <div>
        <h1>HomePage</h1>
        <Link to='/login'>
            <Button color="primary">Sign in</Button>
        </Link>
    </div>
);



export default HomePage;
